        private string serialNum_generate()
        {
            string serialNum = "";
            int denumvalue = 0;
            string denum = "";
            string Adj = "";
            int adjValue = 0;
            denumvalue = int.Parse(DeCWC.Text) + int.Parse(DECW.Text) + int.Parse(DEHPC.Text) + int.Parse(DEHP.Text);
            denum = denumvalue.ToString();
            adjValue = int.Parse(Re_HpAdj.Text) + int.Parse(Re_HWAdj.Text) + int.Parse(Re_HwUnAdj.Text) + int.Parse(Re_HpUnAdj.Text);
            Adj = adjValue.ToString();

            return serialNum = "D" + denum + "R" + Adj;
        }

