        private void write_configdoc(string xmlFilePath,int[] Value)
        {

            XmlDocument myXmlDoc = new XmlDocument();
            XmlElement rootElement = myXmlDoc.CreateElement("controlBoards");
            myXmlDoc.AppendChild(rootElement);

            for (int board = Value[0]; board < (Value[0] + int.Parse(ComData.DeChilledwaterCoil)); board++)
            {
                XmlElement Element = myXmlDoc.CreateElement("controlBoard");
                Element.SetAttribute("name", "DeCoilCw");
                string boardnumber = board.ToString().PadLeft(4, '0') + "0000";
                Element.SetAttribute("boardNumber", boardnumber);
                Element.SetAttribute("targetType", "dehumidifer");
                rootElement.AppendChild(Element);
            }
            for (int board = Value[1]; board < (Value[1]+ int.Parse(ComData.DeChilledwaterNoCoil)); board++)
            {
                XmlElement Element = myXmlDoc.CreateElement("controlBoard");
                Element.SetAttribute("name", "DeNoCoilCw");
                string boardnumber = board.ToString().PadLeft(4, '0') + "0000";
                Element.SetAttribute("boardNumber", boardnumber);
                Element.SetAttribute("targetType", "dehumidifer");
                rootElement.AppendChild(Element);
            }
            for (int board = Value[2]; board <(Value[2] + int.Parse(ComData.DeHeatpumpCoil)); board++)
                {
                XmlElement Element = myXmlDoc.CreateElement("controlBoard");
                Element.SetAttribute("name", "DeCoilHp");
