                rootElement.AppendChild(Element);
            }
            for (int board = Value[3]; board < (Value[3] + int.Parse(ComData.DeHeatpumpNoCoil)); board++)
            {
                XmlElement Element = myXmlDoc.CreateElement("controlBoard");
                Element.SetAttribute("name", "DeNoCoilHp");
